const MenuIcon = () => {
  return (
    <svg viewBox="0 0 100 80" width="40" height="40" border-radius="50">
      <rect width="100" height="20"></rect>
      <rect y="30" width="100" height="20"></rect>
      <rect y="60" width="100" height="20"></rect>
    </svg>
  );
};

export default MenuIcon;
